4:"data";s:84:"http://www.wptouch.com/wptouch/google-start-penalizing-non-mobile-friendly-websites/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:93:"http://www.wptouch.com/wptouch/google-start-penalizing-non-mobile-friendly-websites/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 11 Mar 2015 18:10:59 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:7:"WPtouch";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptouch.com/?p=34308";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:334:"Since the launch of WPtouch in 2008, mobile web usage has skyrocketed. Around the worldÂ ever moreÂ customers are shopping, researching, reading, and connecting with their mobile devices. Visitors to websites are<a class="moretag" href="http://www.wptouch.com/wptouch/google-start-penalizing-non-mobile-friendly-websites/">&#8230;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:20:"Martin Kuplens-Ewart";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1754:"<p>Since the launch of WPtouch in 2008, mobile web usage has skyrocketed. Around the worldÂ ever moreÂ customers are shopping, researching, reading, and connecting with their mobile devices. Visitors to websites are becoming ever less tolerant of pinching and zooming, digging throughÂ pages overloaded with widgets and sidebars, and waiting for overly complex pages to load.</p>\n<p>Google has been working for a few years to encourage website owners toÂ prepare for this shift,Â producingÂ reports andÂ tools to help understand the challenges and opportunities involved. Most recently,Â Google&#8217;s mobile search results began highlighting sites that are optimized for mobile devices.</p>\n<p>As of April 21, Google will beÂ stepping up their pressure on website owners to beÂ ready for mobile visitors. Starting then,Â sites that Google recognizes as mobile friendly will beÂ pushed to the top of results when searching on a mobile device. WebsitesÂ that are not ready for mobile visitors will be penalized with lower ranking in resultsâmeaning less traffic, fewer ad views, and less revenue.</p>\n<p><img class="alignnone size-full wp-image-34331" src="http://cdn1.wptouch.com/wp-content/uploads/2015/03/search-mobile-friendly-one-site-no-header.png" alt="search-mobile-friendly-one-site-no-header" width="640" height="325" /></p>\n<p>Built onÂ seven years&#8217;Â expertise in optimizing WordPress websites for mobile devices,Â WPtouch Pro and all of our themes achieve Google&#8217;s &#8220;Mobile-friendly&#8221; rating.</p>\n<p>If you want to avoid being penalized on mobile searches onÂ April 21, now is the time to <a href="/pricing">get started withÂ WPtouch</a>, Google&#8217;sÂ recommended mobileÂ solution for WordPress website owners.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:89:"http://www.wptouch.com/wptouch/google-start-penalizing-non-mobile-friendly-websites/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:45:"MobileStore: now with WooCommerce 2.3 support";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:76:"http://www.wptouch.com/themes/mobilestore-1-0-9-now-woocommerce-2-3-support/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:85:"http://www.wptouch.com/themes/mobilestore-1-0-9-now-woocommerce-2-3-support/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 24 Feb 2015 18:58:25 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:6:"Themes";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptouch.com/?p=33845";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:304:"If you run an eCommerce website, you know it&#8217;s important to keep your software up to date.Â Today we released an update to our incredible MobileStore mobile theme for WooCommerce which<a class="moretag" href="http://www.wptouch.com/themes/mobilestore-1-0-9-now-woocommerce-2-3-support/">&#8230;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:20:"Martin Kuplens-Ewart";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:877:"<p>If you run an eCommerce website, you know it&#8217;s important to keep your software up to date.Â Today we released an update to our <a href="/themes/mobilestore">incredible MobileStore mobile theme for WooCommerce</a> which integrates full support for the recentÂ WooCommerce 2.3 update.</p>\n<p>Once you&#8217;ve upgraded to MobileStore 1.0.9 you&#8217;ll also find a new feature for your store: a carousel of top-selling products right on your store homepage. It&#8217;s just a small taste of what&#8217;s coming soonÂ when we roll out MobileStore&#8217;s new tablet supportÂ in March.</p>\n<p>Still running WooCommerce 2.2, don&#8217;t worry: we&#8217;ve made sure to keep MobileStore compatible with your store, too.</p>\n<p>We&#8217;ve also released WPtouch Pro 3.7.1, which addresses a compatibility concern between WooCommerce and our new shortcode support method.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:81:"http://www.wptouch.com/themes/mobilestore-1-0-9-now-woocommerce-2-3-support/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:52:"WPtouch Pro 3.7: Shortcodes, Shortcodes, Shortcodes!";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:59:"http://www.wptouch.com/releases/wptouch-pro-3-7-shortcodes/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:68:"http://www.wptouch.com/releases/wptouch-pro-3-7-shortcodes/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 12 Feb 2015 16:29:59 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptouch.com/?p=33462";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:313:"Shortcodes areÂ a truly remarkable feature of WordPress.Â TheyÂ make it possible to easilyÂ addÂ advanced functionality and features to pages, inject content into posts, and more. In the past, site owners have had to<a class="moretag" href="http://www.wptouch.com/releases/wptouch-pro-3-7-shortcodes/">&#8230;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:20:"Martin Kuplens-Ewart";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3533:"<p>Shortcodes areÂ a truly remarkable feature of WordPress.Â TheyÂ make it possible to easilyÂ addÂ advanced functionality and features to pages, inject content into posts, and more. In the past, site owners have had to rely on plugins to add shortcode capabilities to their site butÂ recently someÂ developers have started including them in their WordPress themes. It&#8217;s an attractive proposition forÂ site owners: buy a theme and instantly get advanced functionality without chasing down a handful ofÂ plugins.</p>\n<h2>TroubleÂ with Shortcodes</h2>\n<p>ButÂ WordPressÂ is forgetful. It only remembers how to handle shortcodes for one page request and must re-learn every shortcode each time a page is loaded. It is this forgetfulness that makes itÂ possible to activate a new theme and instantly have a transformed admin experience!Â And usually, with plugins registering advanced functionality, itÂ worksÂ great. After all, plugins are loaded on every request, regardless of which theme is active.</p>\n<p>If you&#8217;ve everÂ swapped out yourÂ WordPress theme toÂ one that doesn&#8217;t have the same shortcodes, though, you&#8217;ll already be familiar with the problem: WordPressÂ suddenly can&#8217;t understand theÂ shortcode and leaves it in yourÂ pages and posts unprocessed!</p>\n<p>WPtouch ProÂ works the same way: when the pluginÂ stepsÂ in to take care of your mobile visitor, itÂ beginsÂ byÂ telling WordPress to set aside your desktop theme and use your chosen mobile theme instead.Â If your content has relied on shortcodes from the desktop theme, you may have seen unprocessed shortcodes appearÂ in your posts and on your pages.</p>\n<h2>Making Progress</h2>\n<p>The sameÂ problemÂ existed in the past with custom post types. We madeÂ <a href="/releases/wptouch-updates-free-goes-international-better-custom-post-types/">bigÂ progressÂ with custom post types in 2014</a>Â enabling WPtouch Pro to learn about the custom post types used in your site and then re-registering them when your site is accessed. As a result, WordPressÂ always knows they exist, and is able to load your content for mobile visitors.</p>\n<p>Although in the past we&#8217;veÂ encouraged site owners to make use of our ability to load your desktop theme&#8217;s functions.php files to try to fix this issue, the complexity of modern WordPress themes has made thisÂ less useful than it has been in the past. After reaching out to major theme framework developers to try to find a resolution to the shortcode problem, we determined the time had come for a complete re-think of our approach.</p>\n<h2>AÂ new approach â and a solution</h2>\n<p>Today shortcode compatibility for mobile visitorsÂ is takingÂ a huge leap forward with <strong>WPtouch Pro 3.7</strong>. With just one click you can enable our all-new shortcode handling, which loads your page and post text as though the desktop theme had been active all along.</p>\n<p>Although this new feature will take care of almost all needs, youÂ mayÂ need to useÂ WPtouch Pro&#8217;s <em>custom code</em> feature to include any styling/scripts relied on for advanced functionality such as content tabbing.</p>\n<p>TheÂ WPtouch Pro 3.7 update isÂ <strong>available now</strong> for all customers with an active license, via your WordPress dashboard for licensed sites and <a href="/account">theÂ Account page</a> here on wptouch.com.</p>\n<p>We&#8217;re excited to finally be able to share this development with you and look forward to your feedback and to seeing what you do with WPtouch Pro.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:64:"http://www.wptouch.com/releases/wptouch-pro-3-7-shortcodes/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:15:"Happy New Year!";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:47:"http://www.wptouch.com/releases/happy-new-year/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:56:"http://www.wptouch.com/releases/happy-new-year/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 03 Feb 2015 14:37:58 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptouch.com/?p=33220";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:261:"OK, IÂ missed New Year&#8217;s Eve by a monthâbut there is still have much to celebrate: the release of WPtouch Pro 3.6.6 and a whole new support system! If you haven&#8217;t<a class="moretag" href="http://www.wptouch.com/releases/happy-new-year/">&#8230;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:20:"Martin Kuplens-Ewart";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3053:"<p style="font-weight: bold;">OK, IÂ missed New Year&#8217;s Eve by a monthâbut there is still have much to celebrate: the release of WPtouch Pro 3.6.6 and a whole new support system!</p>\n<p>If you haven&#8217;t updated WPtouch Pro since we emailed you in November, you&#8217;ve missed a fair bit! We added tools to help you manage your WPtouch Pro license from inside the plugin in 3.6.2.</p>\n<p>In 3.6.3 we reworked our theme &amp; extension system to automatically update whenever you update the WPtouch Pro plugin. And throughout we&#8217;ve made improvements and updated translations across the entire plugin. Many of those haveÂ carried across to the free edition, too.</p>\n<p><img class="alignnone wp-image-33234 size-full" src="http://cdn1.wptouch.com/wp-content/uploads/2015/02/umbrella-man.png" alt="umbrella-man" width="580" height="215" /></p>\n<p>After almost two years of trying we finally accepted that our support system was getting in the way more than it was helping us provide you with great support.</p>\n<p>If you logged in to wptouch.com this week you will have seen the all-new My Account page, with license management tools, renewals, past purchases, and more all in one place.</p>\n<p>We have moved tickets and the knowledgebase (now called &#8216;Solutions&#8217;) to Freshdesk, a great customer support system that lets you get help from us more easily than before.</p>\n<p>Best of all, there&#8217;s no new account or password needed: you still login via wptouch.com.</p>\n<p><img class="alignnone wp-image-33236 size-full" src="http://cdn2.wptouch.com/wp-content/uploads/2015/02/366.png" alt="366" width="580" height="184" /></p>\n<p>As always there are a variety of updates in 3.6.6.</p>\n<p><strong>Newly added:</strong></p>\n<ul>\n<li>The ability for themes and extensions to disable Web-App Mode.</li>\n<li>If you set a custom excerpt for your posts, WPtouch will use it when it displays related posts.</li>\n<li>Support for category hierarchy in MobileStore</li>\n</ul>\n<p><strong>Changed:</strong></p>\n<ul>\n<li>More localization updates (German, Greek, Hindi, and Indonesian)</li>\n<li>More robust category listing</li>\n<li>Updated link for support, etc. to point to our new ticket &amp; knowledgebase and the new My Account page.</li>\n<li>Because Web-App Mode is not compatible with off-site payment gateways, MobileStore no longer allows Web-App Mode to be used when no compatible gateways are found.Read out more about <a href="https://wptouch.freshdesk.com/support/solutions/articles/5000548268-mobilestore-and-web-app-mode">MobileStore and Web-App Mode in our support article</a>.</li>\n<li>MobileStore now allows selecting a custom latest posts page.</li>\n</ul>\n<p><strong>And Fixed:</strong></p>\n<ul>\n<li>A bug in MobileStore where it was not possible to completely disable product filters once any had been selected.</li>\n<li>Layout bug in menu on sites with sequential nested menu items.</li>\n</ul>\n<p>We&#8217;re excited about what we&#8217;ve got planned for WPtouch Pro in 2015. Thanks for your continued support!</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:52:"http://www.wptouch.com/releases/happy-new-year/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Auto-updating Themes &amp; Extensions in WPtouch Pro 3.6.3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:81:"http://www.wptouch.com/wptouch/auto-updating-themes-extensions-wptouch-pro-3-6-3/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:90:"http://www.wptouch.com/wptouch/auto-updating-themes-extensions-wptouch-pro-3-6-3/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 18 Dec 2014 21:53:12 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:7:"WPtouch";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptouch.com/?p=32087";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:304:"&#160; Just in time for Christmas we&#8217;ve releasedÂ a pair of updates to WPtouch and WPtouch Pro. This month our focus has been on making life with WPtouch Pro easier. Auto-updating<a class="moretag" href="http://www.wptouch.com/wptouch/auto-updating-themes-extensions-wptouch-pro-3-6-3/">&#8230;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:20:"Martin Kuplens-Ewart";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1825:"<p><img class="aligncenter size-full wp-image-32094" src="http://cdn2.wptouch.com/wp-content/uploads/2014/12/363-blog.jpg" alt="363-blog" width="1200" height="900" /></p>\n<p>&nbsp;</p>\n<p>Just in time for Christmas we&#8217;ve releasedÂ a pair of updates to WPtouch and WPtouch Pro. This month our focus has been on making life with WPtouch Pro easier.</p>\n<h2>Auto-updating themes &amp; extensions</h2>\n<p>Forget about checking for theme &amp; extension updates â whenever you update WPtouch Pro 3, the plugin will check for availableÂ updates and automatically install them for you. If you&#8217;ve made changes to one of WPtouch Pro&#8217;s officialÂ themes, we&#8217;ll copy the theme and install a fresh copy of the original for youÂ to copy across any improvementsÂ you may wish to apply.</p>\n<h2>In-plugin license upgrades</h2>\n<p>You can nowÂ purchase a license upgradeÂ from inside the WPtouch Pro plugin to get instant access toÂ features of advanced licenses.Â If your license is active on more than one site, the upgrade will roll out to the rest of your sites within 20Â minutes of your upgrade.</p>\n<h2>Other updates</h2>\n<ul>\n<li>Added: A little festive spirit with a Christmassy version of our logo!</li>\n<li>Changed: We slimmed down the plugin package by moving screenshots out of the zip file and into the WordPress repository.</li>\n<li>Changed: MobileStore looks up the visitor&#8217;s location to pre-fill some shipping information.Â Because thisÂ relies on url_fopen being enabled we check for that being enabled before performing a lookup.</li>\n<li>Fixed: Updated WPtouch&#8217;sÂ icon font withÂ a new name to avoid conflicts with otherÂ plugins</li>\n<li>Fixed: Pagination glitch in MobileStore search</li>\n</ul>\n<p>If you haven&#8217;t tried WPtouch Pro yet, now is a great time to get started!</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:86:"http://www.wptouch.com/wptouch/auto-updating-themes-extensions-wptouch-pro-3-6-3/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:91:"Choose custom web fonts with the Advanced Typography extension â new with WPtouch Pro 3.6";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:105:"http://www.wptouch.com/wptouch/choose-custom-web-fonts-advanced-typography-extension-new-wptouch-pro-3-6/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:114:"http://www.wptouch.com/wptouch/choose-custom-web-fonts-advanced-typography-extension-new-wptouch-pro-3-6/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 06 Nov 2014 19:59:14 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:10:"Extensions";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:7:"WPtouch";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptouch.com/?p=30826";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:340:"We carefully select the typefaces to be included in WPtouch Pro&#8217;s web font pairings to express a wideÂ variety of personalities that might be appropriate for sites using WPtouch Pro. Although<a class="moretag" href="http://www.wptouch.com/wptouch/choose-custom-web-fonts-advanced-typography-extension-new-wptouch-pro-3-6/">&#8230;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:20:"Martin Kuplens-Ewart";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2294:"<p>We carefully select the typefaces to be included in WPtouch Pro&#8217;s web font pairings to express a wideÂ variety of personalities that might be appropriate for sites using WPtouch Pro. Although they work for many websites, someÂ site owners have contacted us asking how they can choose their own web fonts from the wide range offered by Google FontsÂ â or even use fonts from subscriptionÂ font services. Still others need access to the varied characterÂ subsets available through Google Fonts for languages that use cyrillic, greek, or even devangari. To all ofÂ you,Â we are delighted toÂ say: easily,Â with a few clicks, today. And most importantly:Â <span style="text-decoration: underline;">FREEÂ withÂ all WPtouch Pro licenses</span>!</p>\n<div id="attachment_30873" style="width: 477px" class="wp-caption alignnone"><img class="wp-image-30873 size-full" src="http://cdn1.wptouch.com/wp-content/uploads/2014/11/font-pickers1.jpg" alt="font-pickers" width="467" height="433" /><p class="wp-caption-text">Picking custom fonts with the Advanced Typography extension</p></div>\n<p>With support for the full Google Font library as well as your custom sets from Fontdeck and Typekit, Advanced Typography for WPtouch Pro 3 putsÂ you in complete control of the typographical branding of your website. We&#8217;re excited to be able to putÂ this level of fine control in your hands and can&#8217;t wait to see what you do with it. Other greatÂ new featuresÂ inÂ WPtouch Pro 3.6 include:</p>\n<ul>\n<li>More powerful URL filters &#8211; select pages that WPtouch Pro ignores or have just a few pages of your website displayed with the WPtouch Pro theme.</li>\n<li>Web App Mode startup screens for iPhone 6 and 6+.</li>\n<li>Disable JetPack Jetpack modules (related posts, sharing buttons, like box) when deselected in the plugin compatibility tool.</li>\n<li>Added fine control of various features, including post typeÂ selection for the featured slider, better RTL support, improved galleryÂ handling, and more!</li>\n</ul>\n<p>Get started withÂ WPtouch Pro 3.6 by upgrading through the WordPressÂ admin, downloading a copy from the <a href="http://www.wptouch.com/support/">WPtouch Support site</a>, or <a href="http://www.wptouch.com/pricing/">purchasing your WPtouch Pro license</a> today!</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:110:"http://www.wptouch.com/wptouch/choose-custom-web-fonts-advanced-typography-extension-new-wptouch-pro-3-6/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:60:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:44:"MobileStore: A WPtouch Theme for WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:77:"http://www.wptouch.com/press-release/introducing-mobilestore-for-woocommerce/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:86:"http://www.wptouch.com/press-release/introducing-mobilestore-for-woocommerce/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 02 Oct 2014 19:00:05 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:7:{i:0;a:5:{s:4:"data";s:14:"Press Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"eCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:12:"mobile theme";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:11:"mobilestore";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:7:"Release";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:5;a:5:{s:4:"data";s:5:"Theme";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:6;a:5:{s:4:"data";s:11:"woocommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptouch.com/?p=28405";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:318:"A new WooCommerce theme built with the power of WPtouch. Lightning Fast, Made for Mobile &#38; WooCommerce Expect higher conversions with our new polished mobile theme for WooCommerce. We&#8217;ve worked<a class="moretag" href="http://www.wptouch.com/press-release/introducing-mobilestore-for-woocommerce/">&#8230;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Dale Mugford";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3843:"<p><a href="http://www.wptouch.com/themes/mobilestore/"><img src="http://cdn1.wptouch.com/wp-content/uploads/2014/10/mobilestore-display.jpg" alt="mobilestore-display" width="960" height="800" class="aligncenter size-full wp-image-30190" /></a></p>\n<p><a href="http://www.wptouch.com/themes/mobilestore/">A new WooCommerce theme built with the power of WPtouch.</a></p>\n<h3>Lightning Fast, Made for Mobile &amp; WooCommerce</h3>\n<p>Expect higher conversions with our new polished mobile theme for WooCommerce. We&#8217;ve worked hard to deliver refined user interaction and store exploration. With <a href="http://www.wptouch.com/themes/mobilestore/">MobileStore</a> for WPtouch we analyzed dozens of eCommerce websites and worked to bring the best of commerce for the mobile web together into one package.</p>\n<p>For us, it seems many WooCommerce themes, including responsive themes, fall short of delivering a great mobile shopping experience. It appears many of these themes treat mobile as an afterthoughtâ a thing they have to be able to do to call them &#8220;responsive&#8221;.</p>\n<p>But responsive shouldn&#8217;t mean elements just <em>fit on the page for mobile devices.</em> That&#8217;s simply not enough when it comes to the mobile experience, and customers who come to a shop on their mobile devices need a good shopping experience to want to purchase via mobile.</p>\n<p>That&#8217;s why we put our 6+ years of working on the mobile web towards building <em>MobileStore</em>.</p>\n<p>Both the design and code behind <em>MobileStore</em> have been built together in harmony with <a title="woocommerce" href="http://www.woothemes.com/woocommerce/">WooCommerce</a>, while all standard WooCommerce features are supported and delivered in a cohesive, mobile-centric way.</p>\n<h3>Months in the Making</h3>\n<p>We spent hundreds of hours on MobileStore carefully constructing a smart, intuitive theme that&#8217;s simply a joy to use.</p>\n<p><a href="http://www.wptouch.com/themes/mobilestore/"><img class="aligncenter size-full wp-image-30170" src="http://cdn1.wptouch.com/wp-content/uploads/2014/07/ms-1.jpg" alt="ms-1" width="800" height="600" /></a></p>\n<h3>Elegant Design</h3>\n<p>With MobileStore you get an awesome touch-friendly menu, easy-access everywhere cart, smooth animated product views, including multi-touch zoom and pan product galleries. MobileStore also features a mobile-specific checkout that&#8217;s user-friendly and made to mivs customers through the checkout process smoothly.</p>\n<h3>Customize and Brand</h3>\n<p>Easily choose fonts, brand colors and logos to add to the theme, and make it your own. MobileStore for WPtouch and WooCommerce comes with great features baked it you can easily control.</p>\n<h3>All the Woo You Need</h3>\n<p>MobileStore has built in support for all out-of-the-box WooCommerce features, and we&#8217;ll be adding more support for its popular add-ons going forward. MobileStore works with WooCommerce 2.1 or later.</p>\n<h3>All The Power Of WPtouch</h3>\n<p>You don&#8217;t just get a mobile theme with MobileStore, you get all the powerful features WPtouch customers enjoyâ features like <em>Web-App Mode</em>, which enable iOS visitors to save your store to their home screens just like native apps. Your customers <em>can even make purchases from inside Web-App Mode as well.</em></p>\n<h3>IOS 8 Support</h3>\n<p>Mobile store also fully supports iOS 8, and can leverage <em>Handoff</em> to send your product pages between desktop and iPads and iPhones. We also support iOS&#8217;s new <em>photo credit card feature,</em> which enables customers to take a photo of their credit card to fill out your purchase form.</p>\n<p><a href="http://www.wptouch.com/themes/mobilestore/">MobileStore is available today</a> and is included with all WPtouch Developer/Agency licenses or higher.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:82:"http://www.wptouch.com/press-release/introducing-mobilestore-for-woocommerce/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"5";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:41:"WPtouch Security Update â Version 3.4.7";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:70:"http://www.wptouch.com/releases/wptouch-security-update-version-3-4-7/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:79:"http://www.wptouch.com/releases/wptouch-security-update-version-3-4-7/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 28 Aug 2014 14:37:07 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s: