ew bug fixes. Here&#8217;s a list of what has been changed: Changed: Now allow<a class="moretag" href="http://www.wptouch.com/releases/wptouch-pro-3-4-6-now-available/">&#8230;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Duane Storey";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1011:"<p>We just released <a href="/">WPtouch Pro</a> 3.4.6, which includes a few new features as well as a few bug fixes.</p>\n<p>Here&#8217;s a list of what has been changed:</p>\n<ul>\n<li>Changed: Now allow mid-content advertisements in Multi-ads (Pro only)</li>\n<li>Fixed: Sharing link text no longer output in Related Posts excerpts</li>\n<li>Fixed: Checkboxes &#038; radio buttons in comment forms are visibly checked</li>\n<li>Fixed: Featured slider showing selected pages</li>\n<li>Fixed: Display of comment count at top of posts in Bauhaus after comments have closed</li>\n<li>Fixed: Shortcodes are now processed properly in the Multi-ads extension advertising code (Pro only)</li>\n<li>Fixed: RTL issues with related posts</li>\n</ul>\n<p>You can update WPtouch Pro to the new version from the plugin page. It can take up to four hours to show that a new update is available, so if you don&#8217;t see the update, please try again later. If your license has expired, you can <a href="/renew/">renew it</a> here.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:69:"http://www.wptouch.com/releases/wptouch-pro-3-4-6-now-available/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/module