class="moretag" href="http://www.wptouch.com/affiliates/wptouch-affiliate-program/">&#8230;</a>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Duane Storey";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:955:"<p>We&#8217;re pleased to announce the relaunch of the WPtouch affiliate program, now hosted on the <a href="http://www.shareasale.com">ShareASale</a> platform. If you&#8217;re a fan of WPtouch and want to earn some money by helping to promote the product on your own website or social media channels, then we encourage you to apply.</p>\n<p>The commission for the program is set at 25%, which means you can earn upwards of $87 per sale of WPtouch. For more information please visit <a href="/affiliates/">our WPtouch affiliate program page</a>, or head on over to ShareASale and <a href="http://www.shareasale.com/shareasale.cfm?merchantID=55023">apply for the WPtouch affiliate program</a>.</p>\n<p><em style="font-style: italic;">Note: we generally only accept medium to high-traffic websites with an emphasis on WordPress, web design, web development, or technology.  If you feel your website or channel would be a good fit, then please apply.</em></p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:65:"http://www.wptouch.com/affiliates/wptouch-affiliate-program/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:""