(281, 2, '2012-03-12 01:38:43', '2012-03-12 01:38:43', 'On Saturday my fellow <a href="http://www.ypmp.org/">YPMP</a> members and I put on our chefs hats and cooked up some pretty amazing food at the <a href="http://www.iceculinary.com/">Institute of Culinary Education</a>. With the guidance of Chef Sabrina Sexton, we learned how to make Basil &amp; Italian Parsley Gnocchi, Tri-Colore Salad with Homemade Mozzarella Cheese and Roasted Tomato Vinaigrette AND Chocolate-Caramel Tart with Bittersweet Chocolate Sauce and Whipped cream... that''s a mouth full.\r\n\r\n<img class="alignnone size-full wp-image-282" title="IMG_0292" src="http://localhost/memorabella/wp-content/uploads/2012/03/IMG_0292.jpg" alt="" width="800" height="533" /><img class="alignnone size-full wp-image-283" title="IMG_3541" src="http://localhost/memorabella/wp-content/uploads/2012/03/IMG_3541.jpg" alt="" width="800" height="533" /><img class="alignnone size-full wp-image-284" title="IMG_3546" src="http://localhost/memorabella/wp-content/uploads/2012/03/IMG_3546.jpg" alt="" width="800" height="533" /><img class="alignnone size-full wp-image-285" title="IMG_3552" src="http://localhost/memorabella/wp-content/uploads/2012/03/IMG_3552.jpg" alt="" width="800" height="533" /><img class="alignnone size-full wp-image-286" title="IMG_3558" src="http://localhost/memorabella/wp-content/uploads/2012/03/IMG_3558.jpg" alt="" width="800" height="1200" /><img class="alignnone size-full wp-image-287" title="IMG_3565" src="http://localhost/memorabella/wp-content/uploads/2012/03/IMG_3565.jpg" alt="" width="800" height="533" /><img class="alignnone size-full wp-image-314" title="IMG_3577" src="http://localhost/memorabella/wp-content/uploads/2012/03/IMG_35771.jpg" alt="" width="800" height="1200" /><img class="alignnone size-full wp-image-307" title="IMG_3547" src="http://localhost/memorabella/wp-content/uploads/2012/03/IMG_3547.jpg" alt="" width="800" height="533" /><img class="alignnone size-full wp-image-308" title="I