(1427, 2, '2013-07-20 20:02:54', '2013-07-20 20:02:54', 'Twas a sad July, when 4 of my best friends decided to move to California. I''ve had some of the best times of my life with this crew over the past 3 years. We were so lucky to all be living in NYC together. I will miss you Alex, Joe, Tierney &amp; Efi more than you know! It''s the end of an era, but only the beginning of us. Love you to the moon-ifornia, and back.\r\n\r\n<a href="http://localhost/memorabella/and-away-they-go/img_0329/" rel="attachment wp-att-1433"><img class="alignnone size-full wp-image-1433" alt="IMG_0329" src="http://localhost/memorabella/wp-content/uploads/2013/07/IMG_0329.jpg" width="800" height="533" /></a><a href="http://localhost/memorabella/and-away-they-go/img_0286/" rel="attachment wp-att-1430"><img class="alignnone size-full wp-image-1430" alt="IMG_0286" src="http://localhost/memorabella/wp-content/uploads/2013/07/IMG_0286.jpg" width="800" height="533" /></a> <a href="http://localhost/memorabella/and-away-they-go/img_0288/" rel="attachment wp-att-1431"><img class="alignnone size-full wp-image-1431" alt="IMG_0288" src="http://localhost/memorabella/wp-content/uploads/2013/07/IMG_0288.jpg" width="800" height="533" /></a> <a href="http://localhost/memorabella/and-away-they-go/img_0281/" rel="attachment wp-att-1429"><img class="alignnone size-full wp-image-1429" alt="IMG_0281" src="http://localhost/memorabella/wp-content/uploads/2013/07/IMG_0281.jpg" width="800" height="533" /><a href="http://localhost/memorabella/?attachment_id=1440" rel="attachment wp-att-1440"><img alt="IMG_0308" src="http://localhost/memorabella/wp-content/uploads/2013/07/IMG_03082.jpg" /></a></a><a href="http://localhost/memorabella/and-away-they-go/img_0293/" rel="attachment wp-att-1439"><img alt="IMG_0293" src="http://localhost/memorabella/wp-content/uploads/2013/07/IMG_0293.jpg" width="800" height="533" /></a><a href="http://localhost/memorabella/and-away-they-go/img_0347/" rel="attachment wp-att-1434"><img clas