(1864, 2, '2014-10-10 18:37:36', '2014-10-10 18:37:36', 'Is it possible to go to Paris and not fall in love with it? Doubtful. I just returned from a 5 day solo excursion, and now I''m a full-on parisian wannabe. Traveling alone was something I''d always been encouraged to do but was intimidated for obvious reasons. Well let me tell you, it was SO GREAT. It''s a shame you didn''t get to come on my journey with me, but hopefully you can re-live it through my photos. Enjoy!\r\n\r\n<img alt="IMG_3709" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3709.jpg" width="1000" height="667" /><img alt="IMG_4450" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_4450.jpg" width="1500" height="1000" /><img class="alignnone size-full wp-image-1865" alt="IMG_3692" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3692.jpg" width="1000" height="667" /><img alt="IMG_3696" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3696.jpg" width="1000" height="667" /><img class="alignnone size-full wp-image-1882" alt="IMG_4470" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_4470.jpg" width="1000" height="1500" /><img class="alignnone size-full wp-image-1868" alt="IMG_3719" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3719.jpg" width="1000" height="667" /><img class="alignnone size-full wp-image-1886" alt="IMG_4495" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_4495.jpg" width="1500" height="1000" /><img class="alignnone size-full wp-image-1870" alt="IMG_3733" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3733.jpg" width="1000" height="1500" /><img class="alignnone size-full wp-image-1869" alt="IMG_3723" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3723.jpg" width="1000" height="667" /><img class="alignnone size-full wp-image-1884" alt="IMG_4487" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_4487.jpg" width="1500" hei