(1832, 2, '2014-09-27 18:25:33', '2014-09-27 18:25:33', 'Congrats to Jess &amp; John, for making their 10+ year relationship official! Thank god for the University of Delaware, for bringing these two together (not to mention a few other girls I''ve come to know #bookclub4life). I''ve said it a million times, but Jess and John are one of the strongest couples I know, and their love for each other was never as apparent as it was on this beautiful day at the Cape. Love you both!\r\n\r\n<img class="alignnone size-full wp-image-1857" alt="bridesmaids" src="http://localhost/memorabella/wp-content/uploads/2014/10/bridesmaids1.jpg" width="800" height="487" /><img class="alignnone size-full wp-image-1835" alt="IMG_3521" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3521.jpg" width="800" height="533" /><img class="alignnone size-full wp-image-1836" alt="IMG_3523" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3523.jpg" width="800" height="533" /><img class="alignnone size-full wp-image-1837" alt="IMG_3534" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3534.jpg" width="800" height="533" /><img class="alignnone size-full wp-image-1838" alt="IMG_3552" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3552.jpg" width="800" height="533" /><img alt="IMG_3514" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3514.jpg" width="800" height="533" /><img class="alignnone size-full wp-image-1839" alt="IMG_3562" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3562.jpg" width="800" height="533" /><img class="alignnone size-full wp-image-1840" alt="IMG_3568" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3568.jpg" width="800" height="533" /><img class="alignnone size-full wp-image-1841" alt="IMG_3570" src="http://localhost/memorabella/wp-content/uploads/2014/10/IMG_3570.jpg" width="800" height="533" /><img class="alignnone size-full wp-image-1842" alt="IMG_3575" src="http